import React from 'react';
import './home.css';
import book from './homeAssets/book.png';
import chest from './homeAssets/chest.png';
import reward from './homeAssets/trophy.png';

function Home() {
  return (
    <div className="app-container">
      <header className="header">
        <div>
        <h1>Chapitre 1</h1>

        </div>
        <p>Apprendre l'alphabet</p>
        <img src={book} alt="lesson-icon" className="icon" />
      </header>

      <main className="main-content">
      <body>
      <img src={chest} alt="chest-icon" className="icon" />
      <img src={reward} alt="reward-icon" className="icon" />
      </body>
      </main>
    </div>
  );
}

export default Home;
